import React from "react";


function YourDestinations({ booked }) {
  return (
    <div>
      <h1>Here are your booked destinations</h1>
      <div className="bg-amber-100 p-4 rounded-b-md">
        <ul className="flex flex-wrap justify-center gap-4">
          {booked.map((destination) => (
            <BookedDestination key={destination.id} booked_dest={destination} />
          ))}
        </ul>
      </div>
    </div>
  );
}

export default YourDestinations;
